import React from 'react';
import './Preloader.css'; // Import the CSS file for styling

const Preloader = () => {
  return (
    <div className="preloader">
      <video autoPlay loop muted className="preloader-video">
        <source src="/public" type="video/mp4" />
        .
      </video>
      <div className="preloader-overlay">Loading...</div>
    </div>
  );
};

export default Preloader;
